import { Model, DataTypes } from 'sequelize';

export default (sequelize, DataTypes) => {
  class NFT extends Model {
    static associate(models) {
      // define associations here
    }
  }
  
  NFT.init({
    tokenId: {
      type: DataTypes.INTEGER,
      allowNull: false,
    },
    owner: {
      type: DataTypes.STRING,
      allowNull: false,
    },
    amount: {
      type: DataTypes.INTEGER,
      allowNull: false,
      defaultValue: 1,
    },
    uri: {
      type: DataTypes.STRING,
      allowNull: true,
    },
    txHash: {
      type: DataTypes.STRING,
      allowNull: true,
    },
    status: {
      type: DataTypes.ENUM('pending', 'minted', 'failed'),
      allowNull: false,
      defaultValue: 'minted',
    },
    mintedAt: {
      type: DataTypes.DATE,
      allowNull: true,
    },
  }, {
    sequelize,
    modelName: 'NFT',
  });

  return NFT;
};

