    "type": "function"
  },
  {
    "inputs": [
      {
        "internalType": "uint256",
        "name": "_tokenId",
        "type": "uint256"
      }
    ],
    "name": "uri",
    "outputs": [
      {
        "internalType": "string",
        "name": "",
        "type": "string"
      }
    ],
    "stateMutability": "view",
    "type": "function"
  }
];

const contract = new ethers.Contract(CONTRACT_ADDRESS, abi, signer);


const mintFee = ethers.utils.parseEther("0.0001");

export const mintNFT = async (req, res) => {
    try {
      const { to, tokenId, amount } = req.body;
  
      // Kim tra d liu u vo
      if (!to || !tokenId || !amount) {
        return res.status(400).json({ error: "Missing required fields: to, tokenId, or amount" });
      }
  
      if (!ethers.utils.isAddress(to)) {
        return res.status(400).json({ error: "Invalid wallet address" });
      }
  
      if (isNaN(tokenId) || isNaN(amount) || amount <= 0) {
        return res.status(400).json({ error: "Invalid tokenId or amount" });
      }
      const totalPrice = BigInt(mintFee) * BigInt(amount);

      const tx = await contract.mint(to, tokenId, amount, {
        value: totalPrice
      });
      await tx.wait();
  
      await nft_mints.create({
        user_address: to,
        tokenId: tokenId,
        amount: amount,
        tx_hash: tx.hash,
        mint_time: new Date(),
      });

      // Phn hi thnh cng
      res.json({
        message: " Mint successful",
        txHash: tx.hash,
        to,
        tokenId,
        amount
      });
    } catch (err) {
      console.error(" Mint error:", err);
      res.status(500).json({ error: err.message || "Internal server error" });
    }
  };

